function subStatForStudio(payreqid, this_tag) {
    var value = this_tag.value;

    $.ajax({
        type:'post',
        url:'/admin/sub_stat_studio',
        data:{
            payreqid: payreqid,
            value: value,
            '_token':Laravel.csrfToken
        },
        success:function(){
            $('.sub_stud_status_mess').fadeIn(1000);
            setTimeout(function(){
                $('.sub_stud_status_mess').fadeOut(1000);
            },3000)
        }
    })
}



